const deleteEventService = async id => {
  const response = await fetch("http://localhost:8000/api/events/get", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({ eventID: id }),
  }).then(res => res.json());

  return response;
};

export { deleteEventService };
